import React from "react";
import { useParams } from "react-router-dom";
import YouTube from "react-youtube";

function Youtube() {
  const { id } = useParams();
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100",
      }}
    >
      <YouTube videoId={id} />
    </div>
  );
}

export default Youtube;
